import React from "react";
import Lives from "./Lives";
import Score from "./Score";
import Chances from "./Chances";
import { Menu } from "semantic-ui-react";

export default function ScoreBoard() {
  return (
    <Menu className="scoreboard">
      <Lives />
      <Score />
      <Chances />
    </Menu>
  );
}
